pragma solidity ^0.5.10;

import './MultiSigWallet.sol';
import '../standards/ERC721/IERC721Receiver.sol';

contract UntangledMultiSignatureWallet is MultiSigWallet, IERC721Receiver {
    mapping(bytes32 => bool) public signedDataHashes;

    constructor(address[] memory _owners, uint256 _required) public MultiSigWallet(_owners, _required) {}

    // For verify VRS signature: contract can call to.isContract() to check and call method isDataSigned() to verify signature
    function signData(bytes memory dataToSign) public onlyWallet {
        signedDataHashes[sha256(dataToSign)] = true;
    }

    function isDataSigned(bytes memory data) public view returns (bool) {
        return signedDataHashes[sha256(data)];
    }

    function onERC721Received(
        address operator,
        address from,
        uint256 tokenId,
        bytes memory data
    ) public returns (bytes4) {
        return this.onERC721Received.selector;
    }

    /// @dev Allows to change the number of required confirmations. Transaction has to be sent by wallet.
    /// @param _required Number of required confirmations.
    function changeRequirement(uint256 _required) public onlyWallet validRequirement(owners.length, _required) {
        if (required != _required) {
            required = _required;
            emit RequirementChange(_required);
        }
    }

    /// @dev Allows anyone to execute a confirmed transaction.
    /// @param transactionId Transaction ID.
    // Note: The low level operations never throw exceptions but indicate failures by returning false
    function executeTransaction(uint256 transactionId)
        public
        ownerExists(msg.sender)
        confirmed(transactionId, msg.sender)
        notExecuted(transactionId)
    {
        if (isConfirmed(transactionId)) {
            Transaction storage txn = transactions[transactionId];
            txn.executed = true;

            require(external_call(txn.destination, txn.value, txn.data.length, txn.data), 'Execute transaction failed');
            emit Execution(transactionId);
        }
    }

    /// @dev Allows to remove an owner. Transaction has to be sent by wallet.
    /// @param owner Address of owner.
    function removeOwner(address owner) public onlyWallet ownerExists(owner) {
        isOwner[owner] = false;
        for (uint256 i = 0; i < owners.length - 1; i++)
            if (owners[i] == owner) {
                owners[i] = owners[owners.length - 1];
                break;
            }
        delete owners[owners.length - 1];
        owners.length -= 1;
        if (required > owners.length) changeRequirement(owners.length);
        emit OwnerRemoval(owner);
    }
}
